"use strict";

function letterCombinations(digits) {
    const n = digits.length;
    if (n === 0) {
        return [];
    }
    const chars = ['abc', 'def', 'ghi', 'jkl', 'mno', 'pqrs', 'tuv', 'wxyz'];
    const strs = digits.split('').map(d => chars[parseInt(d) - 2]);
    let res = [];
    for (const s of strs) {
        if (!res.length) {
            res = [...s];
        } else {
            let cache = [];
            for (const item of res) {
                for (const letter of s) {
                    cache.push(item + letter);
                }
            }
            res = cache;
        }
    }
    return res;
}
